@floydmayweather lands a Miami mansion for $18 million sold by @goldendina. The buyer was represented by @realestatedreammaker. 

Spanning three stories, the sleek house offers indoor-outdoor living with a nearly 11,000-square-foot floor plan and a 5,000-square-foot rooftop deck with views of the water and city skyline. Decks line the top two levels, overlooking a patio with a pool, spa, and a private dock that can store a 100-foot boat. #luxurylistings 

